/*Table structure for table `tblbrandbreed` */

DROP TABLE IF EXISTS `tblbrandbreed`;

CREATE TABLE `tblbrandbreed` (
  `bbID` varchar(20) NOT NULL,
  `brandname` varchar(50) DEFAULT NULL,
  `description` varchar(200) DEFAULT NULL,
  `loggedID` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`bbID`),
  UNIQUE KEY `brandname` (`brandname`),
  KEY `loggedID` (`loggedID`),
  CONSTRAINT `tblbrandbreed_ibfk_1` FOREIGN KEY (`loggedID`) REFERENCES `tbllogged` (`loggedID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

