/*Table structure for table `tblproducts` */

DROP TABLE IF EXISTS `tblproducts`;

CREATE TABLE `tblproducts` (
  `productID` varchar(20) NOT NULL,
  `productcode` varchar(50) DEFAULT NULL,
  `productname` varchar(50) DEFAULT NULL,
  `description` varchar(200) DEFAULT NULL,
  `stock` int(10) DEFAULT '0',
  `sellingprice` double DEFAULT NULL,
  `sellingpricewithvat` double DEFAULT NULL,
  `minQTY` int(10) DEFAULT NULL,
  `maxQTY` int(10) DEFAULT NULL,
  `bbID` varchar(20) DEFAULT NULL,
  `categoryID` varchar(20) DEFAULT NULL,
  `loggedID` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`productID`),
  UNIQUE KEY `productname` (`productname`),
  UNIQUE KEY `productnumber` (`productcode`),
  KEY `tblproducts_ibfk_3` (`loggedID`),
  KEY `tblproducts_ibfk_5` (`categoryID`),
  KEY `tblproducts_ibfk_4` (`bbID`),
  CONSTRAINT `tblproducts_ibfk_4` FOREIGN KEY (`bbID`) REFERENCES `tblbrandbreed` (`bbID`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `tblproducts_ibfk_3` FOREIGN KEY (`loggedID`) REFERENCES `tbllogged` (`loggedID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tblproducts_ibfk_5` FOREIGN KEY (`categoryID`) REFERENCES `tblcategory` (`categoryID`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

